import React from "react";
import Footer from "./Footer";
import Header from "./header";

function TermCondition() {
  return (
    <>
      <div className="page-wrapper">
        <Header />
        <section class="service-section privacy-terms"> <div class="container"> <h1>Terms of Use</h1> <p>These Terms of Use are a legally binding agreement between you and Tkxel LLC (“Tkxel”), concerning the terms on which you may access, browse and use this website and its content found in <a href="#">www.tkxel.com</a>. It further governs your use of all the text, information, data, software and visual content that we make available to you. Nothing contained herein shall be deemed to confer any third-party rights or benefits.</p> <p>We encourage you to carefully read these Terms before continuing through this website. Browsing this website indicates that you have read, understood and accepted these Terms without limitation and that you will abide by all applicable rules, regulations and laws. You cannot use this website if you do not accept these Terms. </p> <h2>Changes</h2> <p>We may periodically amend, suspend or discontinue this website and/or its content without prior notice. We may also change, update, add or remove provisions to these Terms without notification so please make sure to read these from time to time.</p> <h2>Rights</h2> <p>By complying with these Terms, you understand and agree that Tkxel reserves all rights to immediately terminate/remove your access to this website without prior notice and without showing any reason, if it suspects breaches or violations of these Terms of Use or other incorporated agreements/guidelines or requests by law enforcement or other government agencies or any other reason that Tkxel reasonably believes good for such termination/removal. You further understand and agree that all terminations shall be made in Tkxel’s sole discretion and that Tkxel shall not be liable to you nor any third party for any termination of your account or access to this website.</p> <h2 class="nitro-offscreen">Copyright</h2> <p class="nitro-offscreen">Any use of this website’s content including text, images, graphics, videos, logos and icons, are the exclusive property of Tkxel, and is protected by U.S. and international copyright laws - use of which for commercial purposes is strictly prohibited. Under no circumstances may any of the content on this website be copied, reproduced, modified, altered (including tampering with any of the technological safeguards), published or distributed in any form without obtaining prior permission. Unauthorized use of any information from this website may violate copyright, trademark and other laws.</p> <p class="nitro-offscreen">To request permission to use any of the content on this website for commercial purposes, please contact us at <a href="#">marketing@tkxel.com</a></p> <h2 class="nitro-offscreen">Use of site content</h2> <p class="nitro-offscreen">Tkxel, in accordance with these Terms, grants you a limited, non-exclusive and revocable license to access, browse and download the given marketing content for internal and business use, provided that you comply with these Terms and do not modify the content in any way, including retaining all copyright and proprietary notices displayed on the website. Any other use of this site’s content without Tkxel’s prior consent is strictly prohibited.</p> <h2 class="nitro-offscreen">Trademarks</h2> <p class="nitro-offscreen">The trademark “Tkxel”, logos and service marks use and displayed on the site are all registered trademarks of Tkxel LLC and shall not be used in any way, published or advertised without prior permission from Tkxel. All other product and company names used or mentioned herein are or may be trademarks™ or registered® trademarks of their respective holders. Use of them does not imply any affiliation with or endorsement by them. Nothing on the site should be taken as granting the right to use any trademark or Tkxel’s any other intellectual property.</p> <h2 class="nitro-offscreen">Electronic communications</h2> 
        <p class="nitro-offscreen">By using our website, you consent to receive electronic communications from us such as notices and other information concerning the website. This communication is part of your relationship with us.</p> <h2 class="nitro-offscreen">Links to third party sites</h2> <p class="nitro-offscreen">We may provide and sometimes use content supported or provided by third-party websites. Our provision of a link to any other site or location is for your convenience only and does not signify our endorsement of any such other site or location, or its contents. Tkxel does not accept liability for any such information found at any other website or internet location, and bears no responsibility for such third-party websites that are governed by the terms of use and privacy policies of the respective third-party content providers.</p> <h2 class="nitro-offscreen">Limitation of liability</h2> <p class="nitro-offscreen">Under no circumstances shall Tkxel be liable for any direct, indirect, punitive, special, or consequential damages, or any other damages whatsoever, for any use of or reliance on this website or obtained from or arising out of your use of this site, including, without limitation, any lost opportunity, lost profits, business interruption, interruption, deletion, defect, loss of programs or data, even if expressly advised or otherwise aware of the possibility of such damages, whether in an action of contract, negligence, tort or otherwise.</p> <h2 class="nitro-offscreen">Disclaimer</h2> <p class="nitro-offscreen">This website and all information contained herein is provided “as is” and “as available” without any warranties, including but not limited to any implied warranty of merchantability or fitness for a particular purpose.</p> <p class="nitro-offscreen">The content, documents, texts, and related illustrations published on this website could include technical inaccuracies or typographical errors. Tkxel LLC. may make changes and/or enhancements in the content of this website at any time, without notification.</p> <p class="nitro-offscreen">Without limiting the generality of the foregoing, we make no warranty that your use of our website will be uninterrupted, timely, secure, or error free or that defects will be corrected. No advice or information, whether oral or written, obtained by you through this website or from us or our subsidiaries/other affiliated companies shall create any warranty. We disclaim all equitable indemnities.</p> <h2 class="nitro-offscreen">Applicable law</h2> <p class="nitro-offscreen">By using this website, you agree that the laws of the US and EU, without reference to the principles of conflict of laws thereof, will govern these Terms of Use and any dispute of any sort that might arise between you and Tkxel.</p> <h2 class="nitro-offscreen">Local laws</h2> <p class="nitro-offscreen">We control and operate the website from our office in Reston, Virginia and some sections of the website may not be appropriate or available for use in other locations. If you use our websites outside the US, you are solely responsible for complying with the local governing laws.</p> <h2 class="nitro-offscreen">Contact us</h2> <p class="nitro-offscreen">If you have any questions about these Terms or otherwise, please contact us at <a href="#">marketing@tkxel.com</a>.</p> <hr class="nitro-offscreen"/> </div> </section>
        <Footer />
      </div>
    </>
  );
}

export default TermCondition;
